      "description": "<p>Telefono Celular Xiaomi Redmi Note 10 Pro 6GB/128GB Garantia Tienda Oficial</p><br><p>El viajero de 108 MP - AMOLED de 120 Hz - Carga rápida de 33 W</p><p>Desafía tus límites con la serie Redmi Note 10.</p><p>De la Antártida al espacio, la serie Redmi Note está lista para conquistar el mundo. Nuestra actitud es desafiar y superar las expectativas una y otra vez.</p><br><p>Desafía tus límites con 108 MP /Sistema de imagen distintivo, supernítido y alucinante.</p><br><p>Descubre detalles nunca vistos La cámara principal de 108 MP te permite hacer fotos ultra nítidas. Haz zoom en la foto para descubrir detalles curiosos e inesperados.</p><br><p>Con la combinación de tres tecnologías de gama alta, la cámara se ha diseñado para la fotografía nocturna. La cámara principal está equipada con ISO nativo dual, con mayor rango dinámico, detalles más vívidos y control de ruido profesional.</p><br><p>El modo nocturno 2.0 con multifotograma RAW reduce de forma eficaz el ruido y ofrece imágenes nocturnas extremadamente nítidas.</p><br><p>Te permite acercarte sin perder el enfoque. La cámara telemacro de 5 MP te permite disparar 2 veces más cerca que un objetivo macro normal, lo que le ofrece maravillas visuales microscópicas</p><br><br><p>Vídeo dual: Las cámaras delantera y trasera funcionan juntas para ayudarte a crear vídeos originales y divertidos. -</p><p>Desafía tus límites con 120 Hz. La pantalla que te ofrece la intensidad del mundo real: AMOLED de 6,67”.</p><br><p>Pantalla con cuidado visual. Alta frecuencia de actualización</p><p>La pantalla se actualiza 120 veces por segundo, estés jugando o desplazándote por el contenido, por lo que el aspecto y la sensación es de fluidez extrema.</p><br><p>Frecuencia de muestreo táctil</p><p>La gran velocidad de respuesta te permite actuar más rápido, lo que supone una ventaja en los juegos y te ayuda a asegurar la victoria.</p><br><p>La pantalla inteligente proporciona la cantidad de brillo exacto.</p><p>Los sensores de luz de 360° pueden ajustar el nivel de brillo automáticamente. Independientemente de si la luz es intensa, tenue o de fondo, la pantalla siempre proporciona el brillo óptimo para disfrutar de la experiencia de lectura definitiva.</p><br><p>Velocidades que desafían los límites: Qualcomm® Snapdragon™ 732G adopta la tecnología de procesamiento de 8 nm con una arquitectura avanzada de CPU y GPU, computación de datos mejorada y capacidad de procesamiento de imágenes, lo que permite que el dispositivo se adapte a los juegos más exigentes y garantiza un funcionamiento sin problemas.</p><br><p>Batería de larga duración de 5020 mAh. Deja de preocuparte por la batería baja.</p><br><p>Agradable a la vista, cómodo en la mano: Gracias a su cuerpo más ligero y delgado, puedes sostenerlo durante más tiempo sin esfuerzo y mostrar su impresionante diseño.</p><br>",
