      "description": "<p>CELULAR SMARTPHONE 6,5\" SAMSUNG GALAXY A12 ANDROID 10</p><p>4 GB / 64 GB / 48 MPx</p><p>SM-A127MZBEARO (Azul)</p><p>SM-A125MZKEARO (Negro)</p><br><p>SE VE TAN BIEN COMO SE SIENTE</p><p>El Galaxy A12 combina una estética de diseño aerodinámico con colores clásicos. Sus refinadas curvas lo hacen cómodo de sostener y permiten una fácil navegación por la pantalla.</p><br><p>ACTUALIZÁ TU FOTOGRAFÍA CON QUAD CAMERA</p><p>Capturá momentos memorables con detalles más nítidos con una cámara principal de 48MP. Ampliá el ángulo de visión con la cámara Ultra Gran Angular. Personalizá el enfoque con la cámara de profundidad o acercate más a los detalles con la cámara macro.</p><br><p>CÁMARA FRONTAL PARA SELFIES IMPRESIONANTES</p><p>Con la cámara frontal de 8 MP y Live Focus es muy fácil capturar selfies asombrosas que destacan tu rostro sobre el fondo.</p><br><p>PODER PARA SEGUIR EN MOVIMIENTO</p><p>Prepará tu día con una batería que no se detiene. Con 5,000 mAh podés seguir con tus actividades durante horas y horas; además, con hasta 15 W de carga rápida adaptativa, Galaxy A12 recupera rápidamente su máxima potencia.</p><br><p>MÁS ESPACIO PARA JUGAR</p><p>El Galaxy A12 combina la potencia de un procesamiento de ocho núcleos con hasta 4 GB de RAM, para un rendimiento rápido y eficiente. Además, disfrutá de 64 GB de almacenamiento interno.</p><br><p>ONE UI PARA CENTRARTE EN LO QUE REALMENTE IMPORTA</p><p>One UI te ayuda a concentrarte en lo que te importa. El hardware y el software funcionan juntos, con contenido y funciones a tu alcance para que puedas acceder a ellos mucho más rápido. Usá el modo oscuro para una experiencia cómoda en la oscuridad. A través de imágenes claras e intuitivas, usar tu smartphone va a ser de lo más natural.</p><br><p>UN ALTO GRADO DE SEGURIDAD PARA PROTEGER LO IMPORTANTE</p><p>Integrado en el hardware y software del smartphone, Samsung Knox protege tu Galaxy A12 desde el momento en que lo prendés. Al ofrecer seguridad multicapa, protege tu información más confidencial del malware y las amenazas maliciosas.</p><br><br><p>- Procesador: Helio P35 2.3 GHz</p><p>- Memoria RAM: 4 GB</p><p>- Almacenamiento: 64 GB (48 GB disponibles) expandible hasta 1 TB</p><p>- Pantalla: PLS LCD 6,5\" HD+ (720 x 1600 px)</p><p>- Sistema operativo: Android 10</p><p>- Cámaras:</p><p>-- Trasera: 48 MP + 5 MP + 2 MP + 2 MP con flash y zoom 10x</p><p>-- Frontal: 8 MP</p><p>- Ranura SIM: Nano-SIM 4FF</p><p>- Conectividad:</p><p>-- Redes 2G / 3G / 4G LTE</p><p>-- WiFi 802.11b/g/n</p><p>-- Bluetooth 5.0</p><p>-- GPS (Glonass, Beidou, Galileo)</p><p>-- USB tipo C 2.0</p><p>-- Conector auxiliar 3.5 mm</p><p>- Sensores: Acelerómetro, luz ambiental, proximidad, dactilar</p><p>- Batería: Polímero de litio de 5000 mAh no removible</p><p>- Autonomía:</p><p>-- En uso de internet: Hasta 20 horas</p><p>-- En reproducción de video: Hasta 21 horas</p><p>-- En reproducción de audio: Hasta 109 horas</p><p>-- En conversación: Hasta 34 horas</p><p>- Dimensiones: 164 x 75,8 x 8,9 mm</p><p>- Peso: 205 gramos</p><br>",
